(let [result (ms/daily-total-degree ms/contacts t0 day-range)
       dat {:day (mapcat keys (vals result))
            :count (mapcat vals (vals result))
            :type (apply concat (map (fn [[k v]] (repeat (count v) k)) result))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :day :count {:group :type :color :type}]]
         [:geom_line]
         [:geom_point]
         [:xlab "Day"]
         [:ylab "Count"]
         [:theme_bw]
         [:ggtitle "Total degree daily expansion"])]
      {:width 7 :height 6}))
